import React from 'react';
import { useParams } from 'react-router-dom';
import BlogPost from '../components/BlogPost';

function Post() {
  const { id } = useParams();

  return (
    <div className="post">
      <BlogPost id={id} />
    </div>
  );
}

export default Post;
